class ProductExceptSelf
{
public:
	// Time Limit Exceeded 발생.
	vector<int> getProductExceptSelf(vector<int>& nums) {
		vector<int> result;

		for (int i = 0; i < nums.size(); i++)
		{
			int n = 1;
			for (int j = 0; j < nums.size(); j++)
			{
				if (i == j) {
					continue;
				}
				n = n * nums[j];
			}

			result.push_back(n);
		}

		return result;
	}

	vector<int> getProductExceptSelf2(vector<int>& nums) {
		int len = nums.size();
		vector<int> result(len);
		result[0] = 1;
		for (int i = 1; i < len; i++)
		{
			result[i] = result[i - 1] * nums[i - 1];
		}
		int right = 1;
		for (int i = len - 1; i >= 0; i--)
		{
			result[i] *= right;
			right *= nums[i];
		}

		return result;
	}
};